        super()
        this.state={

        }
        
        
    }


    delete(d){
        const contenarray = this.props.contenarray.filter(i => i.id !== d.id )
        this.setState({contenarray})
      }  

 //الكتابه 
render() { 

const {datajson   } = this.props

    return(
        <div>
            <table id="table" >
            <tbody>    
                <tr>
            <td  >المدن</td>
            <td >عدد السكان</td>
                </tr>
        {datajson.map(function data(d) {
        
        
            return(
        
                <tr key={d.id} >
                    <td >{d.citie}</td>
                    <td >{d.peples}</td>
                    <td>
                    <button > تعديل </button> 
                    <button  id = "delet" onClick={this.delete.bind(this,d)} > حدف  </button> 
                    </td>
                </tr>
                    )   
                })}
            </tbody>
            </table>
        
    
        </div>
        )

}
}
export default Table;
